		{
			return "\n" + condIdx + ", //Score:" + SortNum() + ", Beny:" + DispBeny()
				+ ", sT:" + skipTrue + ", sP:" + skipPeriod + ", sB:" + skipBenefit
				+ ", nT:" + noTrue + ", nP:" + noPeriod + ", nB:" + noBenefit + ",";
